INSERT INTO "ezcontentobject_attribute" ("id","language_code","version","contentobject_id","contentclassattribute_id","data_text","data_int","data_float","attribute_original_id","sort_key_int","sort_key_string","data_type_string") VALUES (787,'eng-GB',1,226,203,'<?xml version="1.0" encoding="iso-8859-1"?>\012<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/"\012         xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/"\012         xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/">\012  <paragraph>Seven years ago, yesterday, I packed up everything I owned, left many friends behind in San Diego, and moved to San Francisco, (where I knew absolutely no one) to start my job at HotWired on August 12, 1996. The Creative Director hired me as a junior designer, since I knew very little about design for the Web, despite the fact that I had more print design experience than almost every other designer there at the time.</paragraph>\012  <paragraph>Three months after starting the low-paying job, I was depressed, out of money, missed my friends in San Diego, and was convinced I had made the wrong move. I gave notice, told my landlord I was moving out, and arranged to go back to my old job at a design agency in San Diego. Two days before I was to leave HotWired, Jonathan Louie (Design Director at the time) convinced me otherwise, offering me a new position and my first promotion of many more to come. I stayed, and lost a girlfriend in San Diego as a result.</paragraph>\012  <paragraph>Fast-forward to the present?</paragraph>\012  <paragraph>In two days, it will have been 9 months since I left Wired to go out on my own. Friends who know the journey and my initial intimidation of taking the job at HotWired say to me, &quot;?and look where you are now.&quot;</paragraph>\012</section>',1045487555,0,0,0,'','ezxmltext');
